Style.advanced:
.menuMain div.basicComponents_radio.Dark > div > div.align-div > div > div.radio_buttons.horizontal > div > input {
   display:none; 
}

.menuMain div.basicComponents_radio.Dark > div > div.align-div > div > div.radio_buttons.horizontal > div input[type="radio"]:checked+label {
   padding: 2px 4px 4px 4px;
   border-bottom: solid 1px #25A9E0;
}

[data-widgetid="641a1ecf-b272-fc6f-e0ef-66b40d57b234"] > div {
    background: rgb(53, 76, 168);
    text-color: white;
}

[data-widgetid="641a1ecf-b272-fc6f-e0ef-66b40d57b234"] > div span.confirmed {
    color: white;
    font-size: 32px;
    line-height: 1em;
    margin: 0;
}

[data-widgetid="641a1ecf-b272-fc6f-e0ef-66b40d57b234"] div > div > div.text-align > div.htmlContent {
    margin: 0;
    overflow: hidden;
}

.chartSlider div.basicComponents_radio > div > div.align-div > div > div.radio_buttons.horizontal > div > input {
	display: none;
}
.chartSlider div.basicComponents_radio {
	border: solid 1px;
	background: #DCDCDC;
	border-radius: 75px;
	width: 75px;
	margin: 1px;
}

.chartSlider div.basicComponents_radio.Dark {
	background:#636363;
	border-color: #636363;
}

.chartSlider div.basicComponents_radio > div > div.align-div > div > div.radio_buttons.horizontal > div {
	width: 20px;
	border-radius: 120px;
}

.chartSlider div.basicComponents_radio > div input {
	position: absolute !important;
	clip: rect(0, 0, 0, 0);
	height: 1px;
	width: 1px;
	border: 1px;
	overflow: hidden;

}

.chartSlider div.basicComponents_radio > div label {
	float: left;

	margin-top: 2px;

}

.chartSlider div.basicComponents_radio > div input:checked + label {
	background: linear-gradient(to bottom, #FFFFFF 40%, #f0f0f0);
  background-image: -webkit-linear-gradient(top, #FFFFFF 40%, #f0f0f0);
  border-radius: 100%;
	width:15px;
	height:15px;
	position: absolute;
  top: 0px;
  box-shadow: -1px 1px 5px rgba(0, 0, 0, 0.2);
	font-size: 0.1px;
}
.chartSlider div.basicComponents_radio > div input:checked + label::before {
	content: "";
  position: absolute;
  top: 50%;
  left: 50%;
  margin: -6px 0 0 -6px;
  width: 12px;
  height: 12px;
  background: linear-gradient(to bottom, #eeeeee, #FFFFFF);
  background-image: -webkit-linear-gradient(top, #eeeeee, #FFFFFF);
  border-radius: 6px;
  box-shadow: inset 0 1px rgba(0, 0, 0, 0.02);
}


.chartSlider .radio_buttons > div > label {
	font-size:10px;
	width:100px;

}

.chartSlider .radio_buttons > div:last-child > label {
	right: 2px
}

[data-widgetid="d1a0d0b3-4bac-4126-09d2-4080c690e689"] div.section > div.heading > span.title:before  { 
    font-family: FontAwesome; 
    font-size: 12px; 
    display: inline-block; 
    content: '\f085';
}

