{[d]
    select sum Confirmed , sum Recovered, sum Deaths from CovidOpenData where Date = d
 }

PopupData._queryString:
{[c;d]
    select sum(Confirmed), sum(Deaths), sum(Recovered), Country_Region from CovidOpenData where  (Country_Region=c),Date=d
  }

PopupChart._queryString:
{[c]
  
      select sum(Confirmed), sum(Deaths), sum(Recovered) by Date from CovidOpenData where  (Country_Region = c)
  
  }

confirmed._queryString:
{[s]
 
 data:$[(((count s) = 0) | ((count s) > 15));
     update Country:`Global from CovidOpenData ;
     update Country: Country_Region from  CovidOpenData where Country_Region in s
  ];

  res:(select distinct time from t) pj/
  {[t;x] ?[select from t where Country=x;();(enlist `time)!enlist `time;(enlist x)!enlist (last;`spread)]}
  [t;] each exec distinct Country from t:select spread:(sum Confirmed) by Country, time:Date from data;
 
  `time xasc res
  
  
  }

totalcases._queryString:
{[s]
 
 data:$[(((count s) = 0) | ((count s) > 15));
     update Country:`Global from  CovidData ;
     update Country: Country_Region from  CovidOpenData where Country_Region in s
  ];

  res:(select distinct time from t) pj/
  {[t;x] ?[select from t where Country=x;();(enlist `time)!enlist `time;(enlist x)!enlist (last;`spread)]}
  [t;] each exec distinct Country from t:select spread:(sum ConfirmedDelta) by Country, time:Date from data;
 
  `time xasc res
  
  
  }

relative._queryString:
{[date]
   res: select last Date, avg(Lat), Long:avg(Long), sum(Confirmed), sum(Deaths), sum(Recovered), sum(ConfirmedDelta), Opacity: 0.75, Ratio: ratios[sum(Confirmed); 100] +6  by Country_Region from CovidOpenData where Date = date;
   res: (`Country_Region xkey select Country_Region:Country, Population from pop) ij `Country_Region xkey res; 
   select Country_Region, Date, Lat, Long, Confirmed:100*Confirmed%Population, Deaths:100*Deaths%Population, Recovered:100*Recovered%Population,ConfirmedDelta:100*ConfirmedDelta%Population, Ratio, Active: ((Confirmed - Deaths) - Recovered),
      RecoveredRate: (Recovered * 100)  div Confirmed,
      DeathsRate: (Deaths * 100) div Confirmed,
      ActiveRate: (((Confirmed - Deaths) - Recovered )* 100) div Confirmed
      from res where Lat <> 0
 }

